                return(
                    <>
                <div className="card">
                <div className="card-body">
                <span class="card-number card-circle">1</span>
                <span class="card-author">Breakfast</span>
                <h2 className="card-title">Maggi</h2>
                <span className="card-description">
                    Tasty Food Tasty Food Tasty Food Tasty Food Tasty Food Tasty Food
                </span>
                   </div>
                </div>
        </>
        );
        })}
        </div>
        </> 
    );
};
 
export default Menucard;
